import logo from './logo.svg';
import './App.css';

const document_data = [
  { 
    text: "Parchment v0",
    type: "h1",
  },
  {
    text: "Let's see if this works",
    type: "p",
  },
]

function App() {
  return (
    <div className="App">
      {
        document_data.map(line => {
          console.log(line);
          return display(line)
        })
      }
    </div>
  );
}

const display = (line) => {
  if(line.type === 'h1') {
    return (<h1 key={line.text}>{ line.text }</h1>)
  } else {
    return (<p key={line.text}>{ line.text }</p>)
  }
}

export default App;
